query ($owner: String!, $repo: String!, $head: String!) {
  repository(name: $repo, owner: $owner) {
    ref(qualifiedName: $head) {
      associatedPullRequests(first: 1, states: OPEN) {
        edges {
          node {
            id
            number
            url
          }
        }
      }
    }
  }
}
